namespace ToolkitDemo.Models;public partial class Position : ObservableObject{    [ObservableProperty]    private double x = 0.0;    [ObservableProperty]    private double y = 0.0;    [ObservableProperty]    private double z = 0.0;    [ObservableProperty]    private double a = 0.0;    [ObservableProperty]    private double b = 0.0;    [ObservableProperty]    private double c = 0.0;    public override string ToString()    {        return $"{X},{Y},{Z},{A},{B},{C}";    }}